const populateTable = (list) => {
    let marked = tableData(list)
    list = marked[0]
    let nMarked = marked[1]
    // Saves head 
    let uniTable = document.getElementById("uniTable")
    uniTable.innerHTML = ""
    // uniTable.innerHTML = `<tr class="uniTableHeader" id="uniTableHeader"> <th style="width: 20%"> <input type="checkbox"> </th> <th style="width: 80%"> University </th></tr>`
    for (let i = 0; i < list.length; i++) {
        let tr = document.createElement("tr")
        let td = document.createElement("td")
        let tdchild = document.createElement("td")
        let input = document.createElement("input")
        input.type = "checkbox"
        input.id = list[i]["UNITID"]
        input.onclick = function() { routeChange(this.id, this.checked) }
        if (i <= nMarked) {
            input.checked = true
        } else {
            input.checked = false
        }
        tr.className = "tRC"
        tdchild.onclick = function() { newTab(list[i].UNITID) }
        let c_i = giveDataIndex(list[i])
        tr.onmouseover = function() { hBig(c_i, list[i]["UNITID"]) }
        tdchild.className = "universityName"
        td.appendChild(input)
        if (list[i].Name) {
            tdchild.innerHTML = list[i].Name
        }
        tr.appendChild(td)
        tr.appendChild(tdchild)
        uniTable.appendChild(tr)
    }
}

const giveDataIndex = (item) => {
    if (item["nationalu"] == 1 && item["pubpriv"] == 1) {
        return 0
        // Non-Nat Public
    } else if (item["nationalu"] == 0 && item["pubpriv"] == 1) {
        return 1
        // National Private
    } else if (item["nationalu"] == 1 && item["pubpriv"] == 2) {
        return 2
        // Non-National Private
    } else if (item["nationalu"] == 0 && item["pubpriv"] == 2) {
        return 3
    }
}

// Parses unique UNITID to save some time
const tableData = (data) => {
    let values = []
    for (let i = 0; i < data.length; i++) {
        values.push(data[i].UNITID)
    }
    let onList = []
    let notOnList = []
    for (let i = 0; i < university_data.length; i++) {
        if (values.indexOf(university_data[i].UNITID) >= 0) {
            onList.push(university_data[i])
        } else {
            notOnList.push(university_data[i])
        }
    }
    return [onList.concat(notOnList), onList.length - 1]
}

