// Checks/unchecks region headers
const checkRegionHeaders = () => {
    for (let i = 0; i < REGION_STATES.length; i++) {
        for (let j = 0; j < REGION_STATES[i]["States"].length; j++) {
            // If any given state of a region is not checked, uncheck header
            if (!active_parameters["state"].includes(REGION_STATES[i]["States"][j])) {
                checkTheCheck(i + "_" + 1000, false, true)
                break
                // If last state on list is checked, check header
            } else if (active_parameters["state"].includes(REGION_STATES[i]["States"][REGION_STATES[i]["States"].length - 1])) {
                checkTheCheck(i + "_" + 1000, true)
            }
        }
    }
    // Checks/unchecks "All"
    if (active_parameters["state"].length < 51) {
        checkTheCheck("35_1000", false, true)
    } else {
        checkTheCheck("35_1000", true)
    }
}

// Controlling checking/unchecking all states
const checkAllStates = () => {
    // Check All
    let allStates = document.getElementById("allStates")
    if (active_parameters["state"].length < 51) {
        for (let i = 0; i < stateids.length; i++) {
            // If item is newly checked
            if (checkTheCheck(stateids[i], true)) {
                // Add it to active parameters
                active_parameters["state"].push(statenames[i])
            }
        }
        checkTheCheck("35_1000", true)
    } else {
        for (let i = 0; i < stateids.length; i++) {
            // If the item is newly unchecked
            if (!checkTheCheck(stateids[i], false, true)) {
                const j = active_parameters["state"].indexOf(statenames[i])
                if (j > -1) {
                    active_parameters["state"].splice(j, 1)
                }
            }
        }
        checkTheCheck("35_1000", false, true)

    }
    checkRegionHeaders()
    updateGraph()
}
